import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import TextField from '@mui/material/TextField';

function createData(name, prices, img) {
  return { name, prices, img};
}

const rows = [
  createData('Trứng', '10k','https://cdn.tgdd.vn/Files/2020/05/30/1259576/tat-tan-tat-ve-trung-cach-chon-trung-tuoi-ngon-c-760x367.jpg'),
  createData('Xúc xích', '120k' ,'data:image/jpeg;base64,'),
  createData('Kem', '25k','data:image/jpeg;base64,'),
  createData('Sữa', '5k','data:image/jpeg;base64,'),
  createData('bánh mì', '3k','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSl-vyCT8LidwZib4n5xYS1L7GEo7cyUXcLSg&s'),
];

export default function Test() {
  const [searchTerm, setSearchTerm] = React.useState('');

  const filteredRows = rows.filter((row) =>
    row.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className='flex flex-1 mt-[50px] flex-col'>
      <TextField
        label="Tìm kiếm"
        variant="outlined"
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
        style={{ marginBottom: '16px' }}
      />
      <TableContainer component={Paper} >
        <Table  aria-label="simple table">
          <TableHead>
            <TableRow >
              <div className=' flex flex-1  text-[30px] mb-[30px]'>
                <span className=' mr-[120px]'>
                  Tên hàng
                </span>
                <span className=''>
                  Giá
                </span>
              {/* <TableCell className='flex flex-1'>Tên mặt hàng</TableCell>
              <TableCell align="left" >Giá</TableCell> */}
              </div>
            </TableRow>
          </TableHead>
          <TableBody>
            {filteredRows.map((row) => (
              <TableRow
                key={row.name}
                sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
              >
                <div className='w-[250px] flex flex-1'>

                <TableCell component="th" scope="row" className='flex flex-1'>
                  {row.name}
                </TableCell>
                <TableCell align="left">
  <img src={row.img} alt={row.name} style={{ height: '50px' }} />
</TableCell>
                <TableCell align="left">{row.prices}</TableCell>
                </div>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}